@charset "UTF-8";
/\* CSS Document */
#header{
    background-color:white;
    color:white;
    text-align:center;
    padding:5px;
}
iframe {
  height: 100%;
  left: 0;
  position:center;
  top: 0;
  width: 100%;
}

div.highschool{position: left;
    float: left;
